import React from "react";
import Headercrousalservice from "./../components/Headercrousalservice";
import Servicescomponets from "../components/Servicescomponets";

function Services() {
  return (
    <div>
      <Headercrousalservice />
      <Servicescomponets />
      <video
        src="https://res.cloudinary.com/dzayefrfi/video/upload/v1715042473/Blue_White_Modern_Bold_Digital_Marketing_Expert_Video_thy4yp.mp4"
        muted
        autoPlay
        loop
      >
        My brand like image alt
      </video>
    </div>
  );
}

export default Services;
